import React from "react";

const Dropdown = () => {
  return (
    <div className="relative w-full max-w-[400px]">
      <div
        className="p-5 border border-gray-200
        rounded-lg w-full cursor-pointer
      "
      >
        selected
      </div>
    </div>
  );
};

export default Dropdown;
